import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import './index.css';
import Layout from './components/Layout'; // New Layout component
import PrivateRoute from './components/PrivateRoute';
import AdminRoute from './components/AdminRoute';

// Pages
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import DashboardPage from './pages/DashboardPage';
import HomePage from './pages/HomePage';
import ReportsPage from './pages/ReportsPage';
import SavingsPage from './pages/SavingsPage';
import GoalsPage from './pages/GoalsPage';
import AdminPage from './pages/AdminPage';
import TransactionsPage from './pages/TransactionsPage';
import BudgetsPage from './pages/BudgetsPage';
import ContactUsPage from './pages/ContactUsPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route
          path="/"
          element={
            <PrivateRoute>
              <Layout />
            </PrivateRoute>
          }
        >
          <Route index element={<HomePage />} /> {/* Changed to HomePage */}
          <Route path="dashboard" element={<DashboardPage />} /> {/* New Dashboard route */}
          <Route path="transactions" element={<TransactionsPage />} /> {/* Changed to TransactionsPage */}
          <Route path="budgets" element={<BudgetsPage />} /> {/* Changed to BudgetsPage */}
          <Route path="reports" element={<ReportsPage />} />
          <Route path="savings" element={<SavingsPage />} />
          <Route path="goals" element={<GoalsPage />} />
          <Route path="contact-us" element={<ContactUsPage />} /> {/* New Contact Us route */}
          <Route
            path="admin"
            element={
              <AdminRoute>
                <AdminPage />
              </AdminRoute>
            }
          />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
